import React, { useEffect, useState } from "react";
// react router dom
import { Link as RouterLink, useNavigate } from "react-router-dom";
// @mui
import {
  Button,
  Box,
  IconButton,
  Table,
  Tooltip,
  TableBody,
  TableContainer,
  Typography,
  Stack,
} from "@mui/material";
// _mock_
import {
  _mybranchesList2,
  _newBranchesList2,
} from "../../../../../_mock/arrays";
// components
import Iconify from "../../../../../components/iconify";
import Scrollbar from "../../../../../components/scrollbar";
import CustomConfirmDialog from "../../../../../components/confirm-dialog/CustomConfirmDialog";
import { useSettingsContext } from "../../../../../components/settings";
import PaginationItem from "@mui/material/PaginationItem";
import {
  useTable,
  getComparator,
  emptyRows,
  TableNoData,
  TableEmptyRows,
  TableHeadCustom,
  TableSelectedAction,
  TablePaginationCustom,
} from "../../../../../components/table";
import Pagination from "@mui/material/Pagination";
import { makeStyles } from "@material-ui/core/styles";
import { useLocales } from "../../../../../locales";
import { styled } from "@mui/material/styles";
import TableTopSection2 from "../../detailes/TableTopSection2";
//import TablePaginationCustom2 from "../../../../../components/table/TablePaginationCustom2";
import NewBranchTableRow2 from "../../detailes/NewBranchTableRow2";
import TableTopSection from "../../../../../components/table/TableTopSection";
import TablePaginationCustomized from "../../../../../components/table/TablePaginationCustomized";
// redux
import { useDispatch, useSelector } from "react-redux";
// serrvices
import {
  getPendingRestaurantBranches,
  getPendingMarketBranches,
} from "../../../../../redux/services/restaurant_service";
import { DatePicker } from "@mui/x-date-pickers/DatePicker";
import CustomCalender from "../../../../../components/iconify/CustomCalender";
import Image from "../../../../../components/image/Image";
// -----------------------------------------------------------
const useStyles = makeStyles((theme) => ({
  root: {
    "& .MuiPaginationItem-icon": {
      color: "#FFCC63;",
    },
  },
}));
const TABLE_HEAD = [
  { id: "branche_id", label: "branche_id", align: "center" },
  { id: "branche_name", label: "branche_name", align: "center" },
  { id: "branche_status", label: "branche_status", align: "center" },
  { id: "location", label: "location", align: "left" },
  { id: "data_completeness", label: "data_completeness", align: "left" },

  { id: "action", label: "action", align: "left" },
];

// ---------- Styles --------------
const StyledTableContainer = styled(TableContainer)(({ theme }) => ({
  position: "relative",
  overflow: "unset",
  borderRadius: "25px",
  background: "#FFFFFF",
  border: "1.5px solid #ECECEC",
}));

const tableHolderSx = {
  minWidth: 800,
  borderCollapse: "separate",
  borderSpacing: "0px 16px",
  paddingRight: "19px",
  paddingLeft: "19px",
};

const cancelBtnSx = {
  background: "#FFFFFF",
  color: "#535353",
  border: "0.75px solid #BCBCBC",
  fontSize: "12px",
  fontWeight: "500",
  "&:hover": {
    bgcolor: "text.primary",
    color: (theme) =>
      theme.palette.mode === "light" ? "common.white" : "grey.800",
  },
  boxShadow: " 0px 0.75px 1.5px rgba(16, 24, 40, 0.05)",
  borderRadius: "6px",
  paddingLeft: "43px",
  paddingRight: "43px",
};

const confirmBtnSx = {
  fontSize: "12px",
  fontWeight: "500",
  "&:hover": {
    bgcolor: "text.primary",
    color: (theme) =>
      theme.palette.mode === "light" ? "common.white" : "grey.800",
  },
  boxShadow: " 0px 0.75px 1.5px rgba(16, 24, 40, 0.05)",
  borderRadius: "6px",
  paddingLeft: "44px",
  paddingRight: "44px",
};

const actionHolderSx = {
  flexDirection: { xs: "column", md: "row" },
  justifyContent: "space-between",
  alignItems: "center",
  spacing: 2,
  mb: "24px",
};

const totalUserSx = {
  fontSize: "14px",
  fontWeight: 500,
  color: "#BCBCBC",
};

const infoSx = {
  fontSize: "10px",
  fontWeight: 700,
  color: "#BCBCBC",
};

const subHolderSx = {
  flexDirection: { xs: "column", md: "row" },
  alignItems: "center",
  width: { xs: "100%", md: "auto" },
};

const dateTextSx = {
  fontSize: "12px",
  fontWeight: 500,
  color: "#BCBCBC",
  lineHeight: "15px",
};

const defaultPopperSx = {
  "& .MuiPaper-root": {
    // border: "1px solid black",
  },
  "& .MuiCalendarPicker-root": {
    // backgroundColor: "rgba(45, 85, 255, 0.4)"
    "& .MuiPickersPopper-root": {
      inset: "25% auto auto 60%!important",
    },
  },
  "& .Mui-selected": {
    background:
      "linear-gradient(178.18deg, #FFD00D -13.56%, #FF6E3A 158.3%) !important",
    color: "#fff !important",
  },
  "& .PrivatePickersSlideTransition-root": {},
  "& .MuiPickersDay-dayWithMargin": {
    "&:hover": {
      background: "#fdcd855c",
    },
    color: "#5C5C5C",
    fontSize: "12px",
    fontWeight: 700,
  },
  "& .MuiPickersDay-dayOutsideMonth": {
    color: "#B3B2B2",
  },
  "& .MuiDayPicker-weekDayLabel": {
    color: "rgb(255, 166, 0)",
    fontWeight: 700,
    // backgroundColor: "rgba(50, 136, 153)"
  },
  "& .MuiPickersDay-root:not(.Mui-selected)": {
    borderColor: "transparent",
  },
  "& .MuiButton-root": {
    background:
      "linear-gradient(178.18deg, #FFD00D -13.56%, #FF6E3A 158.3%) !important",
    margin: "auto",
    color: "#fff",
    borderRadius: "100px",
    marginBottom: "20px",
    padding: "12px 35px",
  },
  "& .MuiIconButton-root": {
    "&:hover": {
      background: "#fdcd855c",
    },
  },
  "& .MuiTabs-root": { backgroundColor: "rgba(120, 120, 120, 0.4)" },
  ".MuiBox-root": {
    margin: "0px",
  },
};
// -----------------------------------------------------------------

export default function NewBranchwsSection() {
  const [dates, setDates] = useState({
    fromDate: "1990-04-10",
    toDate: "1990-04-18",
  });

  const dispatch = useDispatch();

  const { allbranches, allbranchesMarket } = useSelector(
    (state) => state.branches
  );

  const classes = useStyles();
  const {
    dense,
    page,
    order,
    orderBy,
    rowsPerPage,
    setPage,
    //
    selected,
    setSelected,
    onSelectRow,
    onSelectAllRows,
    //
    onSort,
    onChangeDense,
    onChangePage,
    onChangeRowsPerPage,
  } = useTable();

  const { translate } = useLocales();

  const { themeStretch } = useSettingsContext();

  const navigate = useNavigate();

  const [tableData, setTableData] = useState([]);

  const [openConfirm, setOpenConfirm] = useState(false);

  const [filterName, setFilterName] = useState("");

  const [filterRole, setFilterRole] = useState("all");

  const [filterStatus, setFilterStatus] = useState("all");

  const dataFiltered = applyFilter({
    inputData: tableData,
    comparator: getComparator(order, orderBy),
    filterName,
    filterRole,
    filterStatus,
  });

  const dataInPage = dataFiltered.slice(
    page * rowsPerPage,
    page * rowsPerPage + rowsPerPage
  );

  const denseHeight = dense ? 52 : 72;

  const isFiltered =
    filterName !== "" || filterRole !== "all" || filterStatus !== "all";

  const isNotFound =
    (!dataFiltered.length && !!filterName) ||
    (!dataFiltered.length && !!filterRole) ||
    (!dataFiltered.length && !!filterStatus);

  const handleOpenConfirm = () => {
    setOpenConfirm(true);
  };

  const handleCloseConfirm = () => {
    setOpenConfirm(false);
  };

  const handleDeleteRow = (id) => {
    const deleteRow = tableData.filter((row) => row.id !== id);
    setSelected([]);
    setTableData(deleteRow);

    if (page > 0) {
      if (dataInPage.length < 2) {
        setPage(page - 1);
      }
    }
  };

  const handleDeleteRows = (selected) => {
    const deleteRows = tableData.filter((row) => !selected.includes(row.id));
    setSelected([]);
    setTableData(deleteRows);

    if (page > 0) {
      if (selected.length === dataInPage.length) {
        setPage(page - 1);
      } else if (selected.length === dataFiltered.length) {
        setPage(0);
      } else if (selected.length > dataInPage.length) {
        const newPage =
          Math.ceil((tableData.length - selected.length) / rowsPerPage) - 1;
        setPage(newPage);
      }
    }
  };
  // for restaurents
  useEffect(() => {
    dispatch(getPendingRestaurantBranches(dates));
  }, [dispatch]);

  useEffect(() => {
    setTableData(allbranches);
  }, [allbranches]);
  // ------------- JSX Code ------------
  return (
    <>
      <Box>
        {/* <TableTopSection2 title='new_branches' /> */}
        <Stack sx={{ ...actionHolderSx }}>
          {/* ***** total user **** */}
          <Stack
            direction="row"
            justifyContent="flex-end"
            alignItems="center"
            mb={{ xs: "10px", md: "0px" }}
          >
            <>
              <Typography sx={{ ...totalUserSx }}>
                {translate("new_branches")}:
              </Typography>

              <Typography sx={{ ...totalUserSx, ml: "4px" }}>{}</Typography>
            </>
          </Stack>

          <Stack sx={{ ...subHolderSx }}>
            {/* ---- Date Range ---- */}
            <Stack
              direction="row"
              alignItems="center"
              spacing="18px"
              mr={{ xs: "0px", md: "30px" }}
            >
              {/* ---- form Date ---- */}
              <Stack direction="row" alignItems="center">
                <DatePicker
                  components={{
                    OpenPickerIcon: CustomCalender,
                  }}
                  componentsProps={{
                    actionBar: { actions: ["accept"] },
                  }}
                  PopperProps={{
                    sx: defaultPopperSx,
                  }}
                  disableFuture
                  inputFormat="yyyy-MM-dd"
                  value={dates.fromDate}
                  onChange={(newValue) => {
                    setDates((prev) => {
                      return {
                        ...prev,
                        fromDate: `${newValue.getFullYear()}-${
                          newValue.getMonth() + 1
                        }-${newValue.getDate()}`,
                      };
                    });
                    dispatch(
                      getPendingRestaurantBranches({
                        fromDate: `${newValue.getFullYear()}-${
                          newValue.getMonth() + 1
                        }-${newValue.getDate()}`,
                        toDate: dates.toDate,
                      })
                    );
                  }}
                  renderInput={({ inputRef, inputProps, InputProps }) => (
                    <Box
                      sx={{
                        display: "flex",
                        alignItems: "center",
                        //  border: "1px solid red",
                        height: "48px",

                        paddingRight: {
                          xs: "24px",
                          sm: "24px",
                          md: "24px",
                          lg: "0px!important",
                        },
                        paddingLeft: {
                          xs: "14px",
                          sm: "14px",
                          md: "14px",
                          lg: "0px!important",
                        },
                      }}
                      ref={inputRef}
                      {...inputProps}
                    >
                      {InputProps?.endAdornment}
                    </Box>
                  )}
                />

                <Typography sx={{ ...dateTextSx, ml: "18px", mr: "12px" }}>
                  {dates.fromDate}
                </Typography>
                <img src="/assets/icons/dashboard/arrowNew.svg" alt="" />
              </Stack>

              {/* ----- to date ----- */}
              <Stack direction="row" alignItems="center">
                <Typography fontSize="12px" fontWeight={700} color="#FFCC63">
                  {translate(`to`)}
                </Typography>
                <DatePicker
                  components={{
                    OpenPickerIcon: CustomCalender,
                  }}
                  componentsProps={{
                    actionBar: {
                      // The actions will be the same between desktop and mobile
                      actions: ["no", "accept"],
                    },
                  }}
                  PopperProps={{
                    sx: defaultPopperSx,
                  }}
                  disableFuture
                  inputFormat="yyyy-MM-dd"
                  value={dates.toDate}
                  onChange={(newValue) => {
                    setDates((prev) => {
                      return {
                        ...prev,
                        toDate: `${newValue.getFullYear()}-${
                          newValue.getMonth() + 1
                        }-${newValue.getDate()}`,
                      };
                    });
                    dispatch(
                      getPendingRestaurantBranches({
                        toDate: `${newValue.getFullYear()}-${
                          newValue.getMonth() + 1
                        }-${newValue.getDate()}`,
                        fromDate: dates.fromDate,
                      })
                    );
                  }}
                  renderInput={({ inputRef, inputProps, InputProps }) => (
                    <Box
                      sx={{
                        display: "flex",
                        alignItems: "center",
                        //  border: "1px solid red",
                        height: "48px",
                        paddingRight: {
                          xs: "24px",
                          sm: "24px",
                          md: "24px",
                          lg: "0px!important",
                        },
                        paddingLeft: {
                          xs: "14px",
                          sm: "14px",
                          md: "14px",
                          lg: "0px!important",
                        },
                      }}
                      ref={inputRef}
                      {...inputProps}
                    >
                      {InputProps?.endAdornment}
                    </Box>
                  )}
                />

                <Typography sx={{ ...dateTextSx, ml: "18px", mr: "12px" }}>
                  {dates.toDate}
                </Typography>
                <img src="/assets/icons/dashboard/arrowNew.svg" alt="" />
              </Stack>
            </Stack>

            {/* ---- print and export ---- */}
            <Stack
              mt={{ xs: "15px", md: "0px" }}
              direction="row"
              alignItems="center"
              spacing="18px"
              alignSelf={{ xs: "end", md: "auto" }}
            >
              {/* ----- Print ----- */}
              <Stack direction="row" alignItems="center" spacing={1}>
                <Image
                  disabledEffect
                  src="/assets/icons/dashboard/ic_print.svg"
                />
                <Typography sx={{ ...infoSx }}>{translate("print")}</Typography>
              </Stack>

              {/* ----- Export ----- */}
              <Stack direction="row" alignItems="center" spacing={1}>
                <Image
                  disabledEffect
                  src="/assets/icons/dashboard/ic_export.svg"
                />
                <Typography sx={{ ...infoSx }}>
                  {translate("export")}
                </Typography>
              </Stack>
            </Stack>
          </Stack>
        </Stack>
        <StyledTableContainer>
          <TableSelectedAction
            dense={dense}
            numSelected={selected.length}
            rowCount={tableData.length}
            onSelectAllRows={(checked) =>
              onSelectAllRows(
                checked,
                tableData.map((row) => row.id)
              )
            }
            action={
              <Tooltip title="Delete">
                <IconButton color="primary" onClick={handleOpenConfirm}>
                  <Iconify icon="eva:trash-2-outline" />
                </IconButton>
              </Tooltip>
            }
          />

          <Scrollbar>
            <Table size={dense ? "small" : "medium"} sx={{ ...tableHolderSx }}>
              <TableHeadCustom
                order={order}
                orderBy={orderBy}
                headLabel={TABLE_HEAD}
                rowCount={tableData.length}
                numSelected={selected.length}
                onSort={onSort}
                onSelectAllRows={(checked) =>
                  onSelectAllRows(
                    checked,
                    tableData.map((row) => row.id)
                  )
                }
              />

              {/* ****** table body **** */}
              <TableBody>
                {dataFiltered
                  .slice(page * rowsPerPage, page * rowsPerPage + rowsPerPage)
                  .map((row) => (
                    <NewBranchTableRow2
                      key={row.id}
                      row={row}
                      selected={selected.includes(row.id)}
                      onSelectRow={() => onSelectRow(row.id)}
                      onDeleteRow={() => handleDeleteRow(row.id)}
                    />
                  ))}

                <TableEmptyRows
                  height={denseHeight}
                  emptyRows={emptyRows(page, rowsPerPage, tableData.length)}
                />

                <TableNoData isNotFound={isNotFound} />
              </TableBody>
            </Table>

            {/* <Box 
                        textAlign={"center"} 
                        alignItems={"center"} 
                        paddingBottom={"41px"} 
                        paddingRight={"24px"} 
                        paddingLeft={"24px"} 
                        display={"flex"} justifyContent={"space-between"}
                        >
                            <Box display={"flex"}>
                                <Typography sx={titleStyle}>
                                    {translate("rows_per_page")}
                                </Typography>
                                <img
                                    src="/assets/icons/arrow/arrowDown.svg"
                                    alt="arrow"
                                    style={arrowStyle} />
                            </Box>
                            <Stack className={classes.root} textAlign={"right"}>
                                <Pagination
                                    count={5}
                                    renderItem={(item) => (
                                        <PaginationItem
                                            slots={{ previous: KeyboardDoubleArrowLeftIcon, next: KeyboardDoubleArrowRightIcon }}
                                            {...item}
                                        />
                                    )}
                                    color="primary" />
                            </Stack>
                        </Box> */}
          </Scrollbar>
          {/* --- Strat Table Pagenation --- */}

          <TablePaginationCustomized
            rowsPerPageOptions={[5, 10, 25]}
            component="div"
            count={dataInPage.length}
            rowsPerPage={rowsPerPage}
            page={page}
            onPageChange={onChangePage}
            onRowsPerPageChange={onChangeRowsPerPage}
          />
        </StyledTableContainer>

        {/* ***************** Confirm Daialog popup ***************** */}
        <CustomConfirmDialog
          open={openConfirm}
          onClose={handleCloseConfirm}
          title={translate("delete_item")}
          content={
            <>{translate("are_you_sure_you_want_to_delete_this_branch")}</>
          }
          action={
            <>
              <Button
                sx={cancelBtnSx}
                onClick={() => {
                  handleCloseConfirm();
                }}
              >
                {translate("cancel")}
              </Button>
              <Button
                variant="contained"
                color="primary"
                sx={confirmBtnSx}
                onClick={() => {
                  handleDeleteRows(selected);
                  handleCloseConfirm();
                }}
              >
                {translate("delete")}
              </Button>
            </>
          }
        />
      </Box>
    </>
  );
}

// ----------------------------------------------------------------------

function applyFilter({
  inputData,
  comparator,
  filterName,
  filterStatus,
  filterRole,
}) {
  const stabilizedThis = inputData.map((el, index) => [el, index]);

  stabilizedThis.sort((a, b) => {
    const order = comparator(a[0], b[0]);
    if (order !== 0) return order;
    return a[1] - b[1];
  });

  inputData = stabilizedThis.map((el) => el[0]);

  if (filterName) {
    inputData = inputData.filter(
      (user) => user.name.toLowerCase().indexOf(filterName.toLowerCase()) !== -1
    );
  }

  if (filterStatus !== "all") {
    inputData = inputData.filter((user) => user.status === filterStatus);
  }

  if (filterRole !== "all") {
    inputData = inputData.filter((user) => user.role === filterRole);
  }

  return inputData;
}
